import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>JOHN DOE</h1>
      <nav>
        <ul>
          <li><a href="#home">HOME</a></li>
          <li><a href="#about">SERVICES</a></li>
          <li><a href="#contact">PORTOFOLIO</a></li>
            <li><a href="#projects">PROJECTS</a></li>
            <li><a href="#contact">CONTACT</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
